import './Menu.scss';

export const Menu = ({ data }) => {
    return (
        <div className="ct-menu">
            {
                data.map((item) => {
                    return (
                        <div className="ct-menu__item prefixIcon suffixIcon">
                            <div className='left'>
                                {item.prefixIcon}
                                {item.description}
                            </div>
                            <div className="right">
                                {item.suffixIcon}
                            </div>
                        </div>
                    );
                })
            }
        </div>
    );
}
